(351, 'FA.', 'Fireangel', 'Industrials', 'FireAngel Safety Technology Group plc, together with its subsidiaries, designs, manufactures, markets, distributes, and sells home safety products and accessories in the United Kingdom, Continental Europe, and internationally. The company offers smoke and carbon monoxide detectors and accessories under the Fire Angel, AngelEye, and Pace Sensors brands, as well as carbon monoxide CO sensors. It sells its products through distributors and retailers to the retail, trade, DIY, fire and rescue service, and utilities markets. The company was formerly known as Sprue Aegis plc and changed its name to FireAngel Safety Technology Group plc in June 2018. FireAngel Safety Technology Group plc was founded in 1998 and is headquartered in Coventry, the United Kingdom.', 'GBP', '2019-08-03 19:45:35'),
(352, 'FAB', 'Fusion Antibody', 'Healthcare', 'Fusion Antibodies plc, a contract research organization, engages in the research, development, and manufacture of recombinant proteins and antibodies primarily for cancer and infectious diseases. The company offers antibody identification and discovery services; and a range of antibody engineering services for various stages of therapeutic and diagnostic antibody development. It also engages in the humanization of monoclonal antibodies. In addition, the company provides antibody sequencing services; custom expression and purification of recombinant proteins; transient protein expression; and stable cell line development services, as well as antibody analysis services. It serves pharmaceuticals, biotech, and diagnostic companies worldwide. The company has a collaboration partnership with Celonic AG for the development of high yield stable cell lines. Fusion Antibodies plc was incorporated in 2000 and is headquartered in Belfast, the United Kingdom.', 'GBP', '2019-08-03 19:45:40'),
(353, 'FARN', 'Faron Pharma', 'Healthcare', 'Faron Pharmaceuticals Oy operates as a clinical stage drug discovery and development company in Finland. It has a pipeline of drug development projects focusing on acute organ traumas, vascular damage, and cancer immunotherapy. The company\'s lead product candidate is Traumakine, a recombinant human IFN beta-1a, which is in Phase III clinical trial for the treatment of acute respiratory distress syndrome (ARDS). It also develops Clevegen, an immunotherapy candidate, designed to prevent tumor growth and metastasis that targets the tumor immune suppressor molecule; and D-ARDS, a diagnostic tool to estimate ARDS severity and to follow ARDS outcome. Faron Pharmaceuticals Oy has a collaboration with MediCity unit of Turku University Medical School. The company was founded in 2003 and is headquartered in Turku, Finland.', 'GBP', '2019-08-03 19:45:47'),
(354, 'FBT', 'Forbidden Tech.', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(355, 'FCPT', 'F&C Commercial Property Tst Ld', NULL, NULL, 'GBP', '2019-05-13 20:30:31'),
(356, 'FCRM', 'Fulcrum Utility', 'Utilities', 'Fulcrum Utility Services Limited provides multi-utility infrastructure and related services in the United Kingdom. The company operates through three segments: Infrastructure Services, Gas Transportation, and Dunamis. It provides utility infrastructure and connections services, as well as gas transportation and meter asset management services; and engages in the pipeline business comprising the ownership of gas infrastructure assets and conveyance of gas through its gas transportation networks. The company also offers electricity and electrical infrastructure services. In addition, its services include fuel conversions, gas disconnections, outlet pipework, inspection and maintenance, electricity connections, and biogas connections. Fulcrum Utility Services Limited was incorporated in 2008 and is headquartered in Sheffield, the United Kingdom.', 'GBP', '2019-08-03 19:45:57'),
(357, 'FCS', 'F&C Global Smaller Companies', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(358, 'FCSS', 'Fidelity China Special Situations', NULL, NULL, 'GBP', '2019-05-13 20:30:48'),
(359, 'FDBK', 'Feedback', 'Technology', 'Feedback plc, a medical imaging technology company, provides software and systems to those working in the field of medical imaging worldwide. Its technologies are TexRAD and Cadran. TexRAD is a software tool, which extracts and quantifies texture features in radiological images, assisting research into all tumor types, and uncovers biomarkers in medical images. The company has launched TexRAD Lung for analysis of lung cancer for clinical use in the European Union. The Cadran image platform provides hospitals and research institutes with a comprehensive picture archiving communication system for medical images. It equips users with a platform for image handling from all imaging modalities, such as CT and PET scanners. Cadran Viewer is certified for clinical use in the European Union. Feedback plc was founded in 1958 and is based in Cambridge, the United Kingdom.', 'GBP', '2019-08-03 19:46:04'),
(360, 'FDEV', 'Frontier Dev', 'Technology', 'Frontier Developments plc develops and publishes video games for the interactive entertainment sector in the United Kingdom and internationally. It develops games across various platforms using its cross platform technology. The company was founded in 1994 and is based in Cambridge, the United Kingdom.', 'GBP', '2019-08-03 19:46:07'),
(361, 'FDI', 'Firestone', 'Basic Materials', 'Firestone Diamonds plc mines, explores for, and develops diamond properties in Lesotho and Botswana. Its flagship asset is the Liqhobong diamond mine located in Lesotho Highlands. The company was incorporated in 1998 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 19:46:13'),
(362, 'FDM', 'FDM Group (Holdings)', 'Technology', 'FDM Group (Holdings) plc, together with its subsidiaries, provides information technology (IT) services in the United Kingdom, Ireland, North America, rest of Europe, the Middle East, Africa, and the Asia Pacific. The company is involved in recruiting, training, and placing its own IT and business consultants across various technical and business disciplines, including development, testing, project management and support office, data and operations services, business analysis, business intelligence, production support, client training, and information security. The company was formerly known as Astra Topco Limited and changed its name to FDM Group (Holdings) plc. FDM Group (Holdings) plc was founded in 1991 and is headquartered in London, the United Kingdom.', 'GBP', '2019-08-03 20:04:04'),
(363, 'FDP', 'First Deriv.', 'Technology', 'First Derivatives plc provides software and consulting services internationally. The company operates through Consulting and Software segments. It provides kdb+, an in-memory, time-series database. The company also designs, develops, implements, and supports a range of data and trading systems for front, middle, and back-office operations. In addition, it provides capital markets consulting and managed services, as well as intellectual property and related services. The company serves finance, technology, retail, pharma, manufacturing, telecom, digital marketing, utilities, Industrial Internet of Things, and energy markets. First Derivatives plc was founded in 1996 and is headquartered in Newry, the United Kingdom.', 'GBP', '2019-08-03 20:04:11'),
(364, 'FEN', 'Frenkel Top', 'Financial Services', 'Frenkel Topping Group Plc, together with its subsidiaries, provides independent financial advisory and investment management services to personal injury and clinical negligence victims in the United Kingdom. It also offers wealth management services. The company was incorporated in 2003 and is based in Manchester, the United Kingdom.', 'GBP', '2019-08-03 20:04:19'),
(365, 'FERG', 'Ferguson', 'Industrials', 'Ferguson plc distributes plumbing and heating products in the United States, the United Kingdom, Canada, and Central Europe. It offers plumbing and heating solutions to customers in the residential, municipal, civil and industrial markets, and commercial sectors for repair, maintenance, and improvement (RMI), as well as new construction markets. The company also distributes pipes, valves, fittings, hydrants, meters, and related water management products, as well as offers related services, such as water line tapping and pipe fusion services. In addition, it distributes heating, ventilation, air conditioning, refrigeration equipment, and parts and supplies to specialist contractors in the residential and commercial markets for repair and replacement; and PVF products to industrial customers. Further, the company fabricates and supplies fire protection systems and bespoke fabrication services to commercial contractors for new construction and renovation projects, as well as offers products, services, and solutions to enable maintenance of facilities across various RMI markets. Additionally, it offers supply chain management solutions for PVF; and industrial maintenance, repair, and operations specializing in delivering automation, instrumentation, engineered products, and turn-key solutions. The company also sells its home improvement products directly to consumers, as well as through a network of online stores. In addition, it operates its B2B business primarily under the Ferguson brand; and B2C business under the Build.com brand. Further, the company provides products and services for maintenance of multi-family properties, government agencies, hospitality, education, healthcare, and other facilities. It operates a network of 2,280 branches and 19 distribution centers. Ferguson plc was founded in 1887 and is headquartered in Wokingham, the United Kingdom.', 'GBP', '2019-08-03 20:04:28'),
(366, 'FEV', 'Fidelity European Values', NULL, NULL, 'GBP', '2019-05-13 20:30:53'),
(367, 'FEVR', 'Fevertree Drk', 'Consumer Defensive', 'Fevertree Drinks Plc, together with its subsidiaries, develops and supplies premium mixer drinks in the United Kingdom, the United States, Europe, and internationally. The company\'s products include Indian tonic water, Mediterranean tonic water, elderflower tonic water, aromatic tonic water, Clementine tonic water, citrus tonic water lemon tonic water, ginger beer, ginger ale, smoky ginger ale, spiced orange ginger ale, Madagascan cola, Sicilian lemonade, lemonade, and spring soda water. It sells its products under Fever-Tree brand name to bars and restaurants. The company was formerly known as Fevertree Topco Limited and changed its name to Fevertree Drinks Plc in October 2014. Fevertree Drinks Plc was incorporated in 2013 and is headquartered in London, the United Kingdom.', 'GBP', '2019-08-03 20:04:41'),
(368, 'FFWD', 'Fastfwd Innov', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(369, 'FFX', 'Fairfx Gp', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(370, 'FGP', 'FirstGroup', 'Industrials', 'FirstGroup plc provides passenger transport services. The company\'s First Student segment provides student transportation services through a fleet of approximately 44,000 yellow school buses in North America. This segment also offers charter hire services for school and non-school activities. Its First Transit segment offers public transit management and contracting services, including fixed route, paratransit, shuttle, and vehicle maintenance services to transit authorities, such as federal, state, and local transportation departments, as well as for private institutions, including universities, hospitals, and airports in North America. The company\'s Greyhound segment provides scheduled intercity coach transportation services to approximately 4,000 destinations through a fleet of approximately 1,600 vehicles in the United States and Canada. Its First Bus segment offers local bus services with a fleet of approximately 5,800 buses in the United Kingdom. The company\'s First Rail segment operates passenger rail network that provides intercity, commuter, regional, and sleeper services through a portfolio of Great Western and TransPennine Express franchises; and passenger rail service. FirstGroup plc was incorporated in 1995 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 20:04:46'),
(371, 'FGT', 'Finsbury Growth & Income Trust', NULL, NULL, 'GBP', '2019-05-13 20:30:57'),
(372, 'FIF', 'Fins.food', 'Consumer Defensive', 'Finsbury Food Group Plc, together with its subsidiaries, manufactures and sells a range of cakes, bread, and bakery snack products in the United Kingdom and internationally. It offers a range of bread and morning goods, such as rolls, hot cross buns, muffins, artisan breads, and healthy lifestyle and organic breads, as well as baguettes, doughnuts, and morning pastries under the Village Bakery, Vogel\'s, and Cranks Organic brands; and cakes, including sponge cakes, loaf cakes, seasonal cakes, and individually portioned sweet snacks, such as chocolate cake bites, cake slices, cake bars, and mini rolls. The company supplies its products to multiple grocers under the retailers own brands and various licensed brands. Finsbury Food Group Plc is based in Cardiff, the United Kingdom.', 'GBP', '2019-08-03 20:04:50'),
(373, 'FIH', 'Fih Group', 'Consumer Defensive', 'FIH group plc, through its subsidiaries, engages in retailing, property, insurance, hotels, shipping, and fishing agency businesses in the Falkland Islands and the United Kingdom. The company retails food, clothing, electrical goods, home furnishings, gifts, and DIY products through 6 retail outlets; sells and hires 4x4 vehicles; and offers travel services, such as flight bookings, airport transfers, and luxury coach and walking tours for tourists. It also provides insurance brokerage services; agency services for cruise ships and fishing vessels; and freight and shipping services to and from the Islands. In addition, the company constructs residential and commercial properties with a portfolio of 40 residential, office, and industrial accommodation properties; offers passenger ferry services across the mouth of Portsmouth harbor through 3 vessels; and operates a cruising vessel providing leisure cruises around the Solent in summer. Further, it is involved in the handling, logistics, storage, and installation of fine art and antiquities. The company was formerly known as Falkland Islands Holdings plc and changed its name to FIH group plc in September 2016. FIH Group plc was founded in 1851 and is headquartered in Bishop\'s Stortford, the United Kingdom.', 'GBP', '2019-08-03 20:04:57'),
(374, 'FIPP', 'Frontier Ip', 'Financial Services', 'Frontier IP Group Plc, through its subsidiaries, engages in assisting universities, research institutions, and companies in the development and commercialization of their intellectual property (IP) in the United Kingdom. It develops and manages a portfolio of equity stakes; and licenses income interests from commercially-focused IP. The company was incorporated in 2007 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 20:05:07'),
(375, 'FISH', 'Fishing Rep.', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(376, 'FJET', 'Fastjet', 'Industrials', 'fastjet Plc provides passenger airline services in Africa. The company was formerly known as Rubicon Diversified Investments Plc and changed its name to fastjet Plc in August 2012. fastjet Plc was incorporated in 2006 and is headquartered in London, the United Kingdom.', 'GBP', '2019-08-03 20:05:17'),
(377, 'FLK', 'Fletcher King', 'Real Estate', 'Fletcher King Plc provides a range of property and advisory services in the United Kingdom. It offers services in the areas of property fund management, property asset management, investment broking, valuations, and ratings. The company was incorporated in 1986 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 20:05:26'),
(378, 'FLO', 'Flowtech Fluidpower', 'Industrials', 'Flowtech Fluidpower plc, together with its subsidiaries, distributes engineering components and assemblies in the areas of fluid power industry in the United Kingdom, Ireland, Benelux, and internationally. The company operates through three segments: Flowtechnology, Power Motion Control, and Process. It offers hydraulic rubber and thermoplastic hose assembly kits, hydraulic cylinders and semi-rotary actuators, bespoke hydraulic power units and packs, purification and filtration systems, manipulated pipes and individual machined components, specialist valves and actuation equipment, safety pipework, transfer pumps, breather valves and instrumentals, and mobile systems, as well as various industrial, pneumatic, and hydraulic components. The company also provides transmission, steering, and electrical control for mobile hydraulic equipment providing mobile valve assemblies; and various original equipment manufacturer products. It serves food/beverage, packaging, medical/pharmaceutical, automotive, paper/plastics, mining/quarrying, electric components, rail, agriculture/forestry, off-/on-highway vehicles, metal forming, entertainment, shipbuilding, construction, defence/aerospace, marine/offshore, and power generation industries. The company was founded in 1983 and is headquartered in Wilmslow, the United Kingdom.', 'GBP', '2019-08-03 20:05:30'),
(379, 'FLOW', 'Flowgroup', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(380, 'FLX', 'Falanx Group Limited', 'Industrials', 'Falanx Group Limited, through its subsidiaries, provides cyber defense and intelligence services to blue chip and government clients worldwide. It operates through Falanx Cyber Defence and Falanx Intelligence divisions. The Falanx Cyber Defence division provides cloud-based cyber defense services to government and commercial organizations. The Falanx Intelligence division offers political and security risk, and business intelligence services under the Falanx Assynt name. The company develops software for telecommunications, security, and data analytics; and offers management consultancy services, as well as provides risk assessment and investigation services. Falanx Group Limited was incorporated in 2012 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 20:05:35'),
(381, 'FOG', 'Falcon Oil', 'Energy', 'Falcon Oil & Gas Ltd., an oil and gas company, engages in the acquisition, exploration, and development of unconventional oil and gas assets in Australia, Hungary, and South Africa. It holds 30% interests in three exploration permits covering an area of approximately 1.4 million net acres in the Beetaloo Basin, Northern Territory, Australia. The company also holds a 100% interest in the technical cooperation permit covering an area of approximately 30,327.9 square kilometers in the southwest Karoo Basin, South Africa; and a 100% interest in the Makó production license covering an area of approximately 994.6 square kilometers in the Makó Trough located in south-eastern Hungary. Falcon Oil & Gas Ltd. was incorporated in 1980 and is headquartered in Dublin, Ireland.', 'GBP', '2019-08-03 20:05:53'),
(382, 'FOOT', 'Footasylum', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(383, 'FOX', 'Fox Marble Holdings', 'Basic Materials', 'Fox Marble Holdings PLC operates as a marble company focuses on the extraction and processing of dimensional stone from quarries in the Republic of Kosovo and South East Europe. It operates four quarries, including Cervenillë, Syriganë, and Malishevë in Kosovo; and Prilep in Macedonia. The company was founded in 2011 and is headquartered in London, the United Kingdom.', 'GBP', '2019-08-03 20:06:01'),
(384, 'FPM', 'Faroe Petrol', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(385, 'FPO', 'First Property', 'Real Estate', 'First Property Group plc is a real estate investment firm. It provides fund management, financial, and technical services to the property industry in the United Kingdom and other European countries. The firm manages commercial properties of various fund investors, as well as involves in property investment and trading, property equity finance, and online activities. It also engages in the facilities management of properties, which include contract installation and maintenance of air conditioning and ventilation systems for office working environments. The firm prefers to invest in offices that can be converted into flats . First Property Group plc is based in London, the United Kingdom.', 'GBP', '2019-08-03 20:06:16'),
(386, 'FRAN', 'Franchise Brand', 'Industrials', 'Franchise Brands plc engages in franchising and related activities primarily in the United Kingdom. It provides vehicle repair services, which comprise bumper scuffs, paintwork scratches, minor dents, and alloy wheel repairs under the ChipsAway brand name; and oven cleaning services include cleaning of domestic oven brands and models, such as electric and gas ovens, ranges, microwaves, hobs, extractor fans, and barbecues, as well as various removable components consisting of racks and other removable parts under the Ovenclean brand. The company also operates dog care franchise under the Barking Mad brand; and offers drain clearance and maintenance services comprising high pressure water jetting, CCTV survey, drain or sewer lining, excavation, electro mechanical cleaning, and fat and grease management under the Metro Rod brand name. It operates 450 franchisees in 12 countries. The company was formerly known as FB Holdings plc. Franchise Brands plc was founded in 2008 and is based in Macclesfield, the United Kingdom.', 'GBP', '2019-08-03 20:06:21'),
(387, 'FRCL', 'Foreign & Colonial Investment Trust', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(388, 'FRES', 'Fresnillo', NULL, NULL, 'GBP', '2019-05-13 20:30:57'),
(389, 'FRR', 'Frontera Resources', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
