(400, 'GAN', 'Gan', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(401, 'GATC', 'Gattaca', 'Industrials', 'Gattaca plc, a human capital resources company, provides contract and permanent recruitment services in the private and public sectors. It operates through three segments: UK Engineering, UK Technology, and International. The company offers permanent, fixed term, temporary, contractor, and interim recruitment; contingent recruitment; preferred supplier lists and frameworks; and vacancy and campaign recruitment services. It also provides flexible, permanent, and total workforce solutions; and professional outsourced engineering and technology support solutions, including blank paper design and reverse engineering, and IT desktop migration solutions. The company offers its services for the aerospace, automotive, energy, engineering technology, general engineering, infrastructure, maritime, professional, information technology, and telecommunication markets under the Matchtech, Networkers, Barclay Meade, Alderwood, Cappo, Resourcing Solutions, and Gattaca Solutions brands. It has operations in the United Kingdom, other European countries, the Middle East, Africa, the Americas, and the Asia Pacific. The company was formerly known as Matchtech Group plc and changed its name to Gattaca plc in September 2016. Gattaca plc was founded in 1984 and is based in Fareham, the United Kingdom.', 'GBP', '2019-08-03 22:31:15'),
(402, 'GAW', 'Games Workshop', 'Consumer Cyclical', 'Games Workshop Group PLC, together with its subsidiaries, designs, manufactures, distributes, and retails miniature figures and games in the United Kingdom, Continental Europe, North America, Australia, New Zealand, and Asia. It operates through Trade, Retail, and Online segments. The company offers games under the Warhammer: Age of Sigmar and Warhammer 40,000 names, as well as Horus Heresy, an off shoot of Warhammer 40,000; and Middle-earth battle games. It also publishes various titles, including short stories, audio dramas, and full length novels under the Black Library name. In addition, company offers painting and modelling products, boxed games, and gifts; and engages in the newsstand and trustee businesses. It provides its products through its retail stores, social media sites, and warhammer-community.com, as well as through Games Workshop and third party gaming events; and physical bookstores, third party online platforms, and its own specialist stores. As of June 2, 2019, the company operated 517 Games Workshop stores in 23 countries. Games Workshop Group PLC was incorporated in 1991 and is headquartered in Nottingham, the United Kingdom.', 'GBP', '2019-08-03 22:31:59');
INSERT INTO `stock_symbol_list` (`stock_id`, `stock_symbol`, `stock_name`, `stock_sector`, `stock_description`, `stock_currency`, `last_updated`) VALUES
(403, 'GBG', 'Gb Group', 'Technology', 'GB Group plc, together with its subsidiaries, provides identity data intelligence services in the United Kingdom, the United States, Australia, and internationally. It operates in two segments, Fraud, Risk & Compliance and Customer & Location Intelligence. The company offers ID verification services, which helps in verifying identities remotely without the physical presentation of documentation for combat ID fraud, money laundering, and restricting access to under-age content, purchases, and gambling; and ID employ and comply that provides background checks through an online verification and authentication of individuals. It also offers ID compliance and fraud solutions that provides fraud detection, risk management, and consumer on-boarding solutions; ID location intelligence, which includes software and services for accurate consumer registration and validation of records; and ID engage that provides database and up-to-date identity information for contact strategies. In addition, the company offers an ID trace and investigate solution that provides picture of the UK\'s population and properties in order to locate and contact the right individual. GB Group plc was incorporated in 1989 and is headquartered in Chester, the United Kingdom.', 'GBP', '2019-08-03 22:32:37'),
(404, 'GBGI', 'Gbgi', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(405, 'GBP', 'Global Pet.', 'Energy', 'Global Petroleum Limited engages in the exploration of oil and gas properties in Africa. The company primarily owns a 85% participating interest in the Namibian project consisting of offshore blocks 1910B and 2010A covering an area of 5,810 square kilometers, and 2011A covering an area of 5,798 square kilometers located in the Republic of Namibia. Global Petroleum Limited is headquartered in Brisbane, Australia.', 'GBP', '2019-08-03 22:33:10'),
(406, 'GCM', 'GCM Resources', 'Basic Materials', 'GCM Resources Plc operates as a resource exploration and development company. It primarily develops the Phulbari coal and power project that relates to thermal coal and semi-soft coking coal located in Bangladesh. GCM Resources Plc was incorporated in 2003 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:33:46'),
(407, 'GCP', 'GCP Infrastructure Investments', NULL, NULL, 'GBP', '2019-05-13 20:30:57'),
(408, 'GDL', 'Greka (Di)', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(409, 'GDP', 'Goldplat', 'Basic Materials', 'Goldplat PLC, together with its subsidiaries, engages in the mining, exploration, and production of gold and other precious metals in South Africa and Ghana. The company produces and recovers gold, silver, and platinum group metals. It also engages in the exploration and development of Kilimapesa gold mine located in South Western Kenya. Goldplat PLC was incorporated in 2005 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:34:26'),
(410, 'GDR', 'Genedrive', 'Healthcare', 'genedrive plc, a molecular diagnostics company, engages in developing and commercializing point of need diagnostics platform for infectious diseases, genotyping, pathogen detection, and other indications. It operates through three divisions: Preclinical Research Services, Pharmacogenomic Services, and Diagnostics. The Preclinical Research Services division provides pre-clinical testing services in the areas of oncology, oncology supportive care, inflammatory bowel disease, leukaemia, gastrointestinal disease, inflammation, skin care and wound healing, and rheumatoid arthritis. The Pharmacogenomic Services division offers molecular measures of biological processes. The Diagnostics division is involved in commercializing the Genedrive point of need molecular testing platform. It serves biotechnology and pharmaceutical industries in the United Kingdom, Europe, the United States, and internationally. The company was formerly known as Epistem Holdings Plc and changed its name to genedrive plc in July 2016. genedrive plc was founded in 2000 and is based in Manchester, the United Kingdom.', 'GBP', '2019-08-03 22:35:01'),
(411, 'GEO', 'Georgian Min.', 'Basic Materials', 'Georgian Mining Corporation engages in the exploration and development of copper and gold properties in Georgia and Austria. The company\'s principal property is the Kvemo Bolnisi copper-gold project located in Georgia. It also holds interests in the Tsitsel Sopeli project; the Dambludi base and precious metal project; the Tamarisi project; and the Balichi project located in Georgia. The company was formerly known as Noricum Gold Limited and changed its name to Georgian Mining Corporation in October 2016. Georgian Mining Corporation is based in London, United Kingdom.', 'GBP', '2019-08-03 22:35:28'),
(412, 'GETB', 'Getbusy', 'Technology', 'GetBusy Plc develops and sells document management software products in the United Kingdom, the United States, Australia, and New Zealand. The company focuses on electronic document management, communication, and productivity. It offers SmartVault, a cloud document management system for small and medium enterprises; and Virtual Cabinet, a desktop document management system designed for medium to large enterprise businesses, which allows businesses to automatically file their emails, search content inside their stored documents, approve documents, track files, generate end-to-end audits, and optimize processes and workflows. The company was incorporated in 2017 and is based in Sawston, the United Kingdom.', 'GBP', '2019-08-03 22:36:06'),
(413, 'GFIN', 'Gfinity', 'Consumer Cyclical', 'Gfinity plc, together with its subsidiaries, provides esports solutions worldwide. It operates through two segments, Gfinity and CEVO. The Gfinity segment engages in esports related activities, and provision of broadcast and production services. The CEVO segment provides in-house development capabilities and online esports solutions for third parties, as well as technology services. The company\'s business to business platform delivers managed services to game publishers, sports rights holders, commercial partners, and media companies. It also provides studio and content creation services; and owns and brands leagues and events, including The Gfinity Elite Series, as well as provides access to proprietary community platform. In addition, the company offers IT development and tournament services, as well as event operator services; and engages in online media and sports club activities. Gfinity plc was founded in 2012 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:36:46'),
(414, 'GFM', 'Griffin Mining', 'Basic Materials', 'Griffin Mining Limited, a mining and investment company, engages in the mining, exploration, and development of mineral properties. The company explores for zinc, gold, silver, lead, and base and precious metal deposits. Its principal property is the Caijiaying mine located in Hebei Province, the People\'s Republic of China. The company was formerly known as European Mining Finance Ltd. and changed its name to Griffin Mining Limited in January 1998. Griffin Mining Limited was founded in 1988 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:36:59'),
(415, 'GFRD', 'Galliford Try', 'Consumer Cyclical', 'Galliford Try plc operates as a housebuilding, regeneration, and construction primarily in the United Kingdom. The company operates through Linden Homes, Partnerships & Regeneration, Building, Infrastructure, and PPP Investments segments. The company develops and sells private and affordable homes under the Linden Homes brand name; and builds sustainable communities, as well as provides private housing for sale on regeneration-led sites. It also undertakes infrastructure works, including airports; coastal defense and harbors; commercial; custodial and judicial; data centers; education; assisted living; flood alleviation; ground engineering; health; highways; hotels; infrastructure security; leisure and cultural; oil and gas; rail; remediation; residential; retail; sports facilities and stadium; telecommunications; water; WI-FI and audio visual; and wind farm projects, as well as building projects. In addition, the company offers a range of facilities management and maintenance services for public and private sector organizations. Galliford Try plc was incorporated in 1965 and is based in Uxbridge, the United Kingdom.', 'GBP', '2019-08-03 22:37:26'),
(416, 'GFS', 'G4S', 'Industrials', 'G4S plc, together with its subsidiaries, provides security and related services in Africa, the Americas, Asia, Europe, and the Middle East. The company offers software tools, including evidence based risk assessment, incident management, and travel advisory systems, such as RISK360; and proprietary security systems comprising symmetry connect access control and visitor management systems. It also provides custody, detention, rehabilitation, and care services; automated cash solutions for retailers, automated bulk-teller solution for banks, and mobile banking services, as well as G4S Pay, a retail cash solution; and security advice, risk mitigation strategies, secure support, and integrated solutions. The company serves corporates and industrials, government, financial institutions, private energy/utilities, and ports and airports, as well as the retail, transport and logistics, and leisure and tourism sectors. G4S plc was founded in 1901 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:37:53'),
(417, 'GFTU', 'Grafton Group', 'Basic Materials', 'Grafton Group plc engages in the merchanting, retailing, and mortar manufacturing businesses in Belgium, Ireland, the Netherlands, and the United Kingdom. Its Merchanting segment distributes building and plumbing materials to professional trades people engaged in residential repair, maintenance, and improvement projects, as well as in residential and other new build construction. It also operates in plumbers\' merchanting business. This segment operates 675 branches under the Selco, Buildbase, and Plumbase brands in the South East, Midlands, and North of England; the Chadwicks and Heiton Buckley brands in the Republic of Ireland; the MacBlair brand in Northern Ireland; the Gerritse, Breur Ceintuurbaan, Van der Winkel, and Scholte de Vries-Estoppey brands in the Netherlands; and the YouBuild and MPro brands in Belgium. The company\'s Retailing segment engages in DIY retailing and home improvement business that supplies a range of products, including paints, lighting products, homestyle products, housewares, bathroom products, and fitted kitchens. This segment operates 35 stores primarily under the Woodie\'s brand. Its Manufacturing segment manufactures silo-based mortar for use in a range of residential and commercial construction projects in England and Scotland; and PVC drainage, roofline, and infrastructural ducting products in Dublin. Grafton Group plc is headquartered in Dublin, Ireland.', 'GBP', '2019-08-03 22:38:32'),
(418, 'GGP', 'Greatland', 'Basic Materials', 'Greatland Gold plc engages in the exploration and development of natural resources. It explores for gold, nickel, and cobalt deposits. The company primarily holds 100% interests in six projects, including four situated in Western Australia and two located in Tasmania. Greatland Gold plc was founded in 2005 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:39:07'),
(419, 'GHE', 'Gresham House', 'Financial Services', 'Gresham House plc, an investment trust, engages in property rental and development in the United Kingdom. It also invests in listed securities. The company is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:39:33'),
(420, 'GHH', 'Gooch & Housego', 'Technology', 'Gooch & Housego PLC researches, designs, engineers, manufactures, and sells photonic systems, components, and instrumentation in the United States, continental Europe, the United Kingdom, the Asia Pacific, and internationally. It operates in four segments: Aerospace & Defence, Life Sciences, Industrial, and Scientific Research. The company offers acoustic products, such as acoustic optic modulators, beam deflectors, fiber-coupled modulators, frequency shifters, model lockers, multi-channel modulators, pulse pickers and cavity dumpers, acousto-optic tunable filters, and RF drivers; and crystal optics, including lithium niobate wafers, nonlinear optic crystals, and periodically-poled lithium niobate. It also provides electro-optic products comprising lithium niobate Q-switches, pockels cell drivers, and pockels cells; and fiber optics comprising fiber-coupled pump lasers, distributed feedback lasers and modules, high speed detectors, benchtop laser controllers, fused fiber optic components, fiber optic assemblies, OCT components and subsystems, and optical fiber amplifiers. In addition, the company offers precision optic products consisting of precision prisms and lenses, corner cubes, SWIR lens assemblies, opto-mechanical assemblies, precision mirrors, synchrotron and research grade mirrors, plate and cube beamsplitters, optical windows and flats, waveplates, superpolished SROC, ring laser gyroscope components, infrared optics, optical domes, ML optics. Further, it provides instrumentation products, including spectroradiometers, spectral imaging and synthesis, spectral radiance and luminance standards, spectral irradiance and illuminance standards, reflectance standards, integrating spheres, radiometers/photometers, detector standards, precision constant current sources, imaging photometers, and colorimeters/photometers. Gooch & Housego plc was founded in 1948 and is based in Ilminster, the United Kingdom.', 'GBP', '2019-08-03 22:40:18'),
(421, 'GHS', 'Gresham House Strategic', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(422, 'GLEN', 'Glencore', 'Basic Materials', 'Glencore plc engages in the production, refinement, processing, storage, transport, and marketing of metals and minerals, energy products, and agricultural products. It operates in three segments: Metals and Minerals, Energy Products, and Agricultural Products. The Metals and Minerals segment is involved in smelting, refining, mining, processing, and storing zinc, copper, lead, alumina, aluminum, ferroalloys, nickel, cobalt, and iron ore. The Energy Products segment activities include coal mining and oil production operations covering crude oil, oil products, steam coal, and metallurgical coal; and investments in ports, vessels, and storage facilities. The Agricultural Products segment engages in the storage, handling, processing, and port facilities of wheat, corn, canola, barley, rice, oil seeds, meals, edible oils, biofuels, cotton, and sugar. Glencore plc markets and delivers physical commodities sourced from third party producers and its production to industrial consumers in the automotive, steel, power generation, oil, semi-fabricator, and food processing industries. The company also provides financing, logistics, and other services to producers and consumers of commodities. It operates in the Americas, Europe, Asia, Africa, Oceania, and internationally. The company was formerly known as Glencore Xstrata plc and changed its name to Glencore plc in May 2014. Glencore plc was founded in 1974 and is headquartered in Baar, Switzerland.', 'GBP', '2019-08-03 22:41:11'),
(423, 'GLIF', 'Gli Finance', 'Financial', NULL, 'GBP', '2019-08-03 22:41:41'),
(424, 'GLO', 'Contourglbl', 'Utilities', 'ContourGlobal plc, together with its subsidiaries, acquires, owns, develops, and operates wholesale power generation businesses in Europe, Latin America, Africa, and the Caribbean islands. The company operates in Thermal Energy and Renewable Energy segments. It generates electricity from coal, lignite, natural gas, fuel oil, diesel, wind, solar, and hydro power plants with total installed capacity of 1,424 MW in Latin America and 228 MW in Africa. The company was founded in 2005 and is based in London, the United Kingdom. ContourGlobal plc is a subsidiary of ContourGlobal LP.', 'GBP', '2019-08-03 22:42:14'),
(425, 'GLR', 'Galileo Resourc', 'Basic Materials', 'Galileo Resources Plc, through its subsidiaries, engages in the exploration of natural resources in South Africa, the United States, and Zambia. The company explores for zinc, phosphate, copper, lead, silver, and gold deposits. It primarily focuses on exploring the Star Zinc project located to the northeast of Lusaka, Zambia. The company was incorporated in 2006 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:42:49'),
(426, 'GMAA', 'Gama Aviation', 'Industrials', 'Gama Aviation Plc provides business aviation services. The company offers aircraft management services for aircraft owners, such as fuel and insurance, crew, and maintenance services; aircraft chartering services; aero-medical services; and contract air services. It also provides phased or base maintenance, line maintenance, and design and modifications services; fixed base operations (FBO) comprising parking, hangarage, and fueling, of aircraft and the processing of passengers; rotary maintenance, general aviation maintenance, aviation engineering design, avionics upgrades, and flight training services; and Airops software for third party FBO and flight management departments. It has operations in the Middle East, North Africa, the United States, Asia, Europe, and internationally. Gama Aviation Plc was founded in 1983 and is headquartered in Farnborough, the United Kingdom. Gama Aviation Plc is a subsidiary of Gama Group Limited.', 'GBP', '2019-08-03 22:43:27'),
(427, 'GMR', 'Gaming Realms', 'Consumer Cyclical', 'Gaming Realms plc develops, publishes, and licenses mobile gaming content in the United Kingdom, the United States, and internationally. The company operates through two segments, Licensing and Social Publishing. The Licensing segment is involved in brand and content licensing to partners. The Social Publishing segment provides freemium games. The company also offers marketing services. Its products include Slingo, bingo, slots, and other casual games. It has strategic partnerships with Fremantle, Zynga, IWG, Pala Interactive, and Scientific Games. Gaming Realms plc was incorporated in 2001 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:44:12'),
(428, 'GNC', 'Greencore Group', 'Consumer Defensive', 'Greencore Group plc manufactures and sells various convenience food products primarily in the United Kingdom. The company provides sandwiches, sushi, salads, chilled ready meals, chilled soups and sauces, chilled quiche, ambient sauces and pickles, frozen Yorkshire puddings, cakes, and desserts. It also trades in Irish ingredients; and invests in properties. The company sells its products through grocery and other retailers, including supermarkets, as well as convenience stores. Greencore Group plc was founded in 1991 and is headquartered in Dublin, Ireland.', 'GBP', '2019-08-03 22:44:40'),
(429, 'GNK', 'Greene King', 'Consumer Cyclical', 'Greene King plc operates as a pub retailer and brewer in the United Kingdom. The company operates through three segments: Pub Company, Pub Partners, and Brewing & Brands. Its brands include Greene King Local Pubs, Hungry Horse, Flaming Grill, Farmhouse Inns, and Chef & Brewer. The company is also involved in brewing, marketing, and selling beer under the Greene King IPA, Old Speckled Hen, Abbot Ale, and Belhaven Best brands. In addition, Greene King plc engages in the employment, financing, pension trustee, and property businesses. As of April 30, 2018, it operated 2,855 managed, tenanted, leased, and franchised pubs, restaurants, and hotels. Greene King plc was founded in 1799 and is headquartered in Bury St Edmunds, the United Kingdom.', 'GBP', '2019-08-03 22:45:23'),
(430, 'GNS', 'Genus', 'Healthcare', 'Genus plc operates as an animal genetics company in North America, Latin America, rest of Europe, the Middle East, Africa, and Asia. The company operates through three segments: Genus PIC, Genus ABS, and Research and Development. It sells sows, boars, and semen to breed pigs with various characteristics for pork production under the PIC brand. The company also sells bull semen and embryos, which are delivered through artificial insemination to breed dairy and beef cattle with various characteristics for milk and beef production under the ABS, Genus, and Bovec brands. In addition, it offers semen sexing, in vitro fertilization, reproductive, and other technical services to farmers; and agricultural and agri-food consultancy services. The company has a strategic porcine collaboration with Beijing Capital Agribusiness Co. Ltd to research, develop, register, and market in China elite PIC pigs that are resistant to Porcine Reproductive and Respiratory Syndrome virus. Genus plc was incorporated in 1994 and is headquartered in Basingstoke, the United Kingdom.', 'GBP', '2019-08-03 22:46:12'),
(431, 'GOAL', 'Goals Soccer', 'Consumer Cyclical', 'Goals Soccer Centres plc operates outdoor soccer centers. The company operates 50 football club sites, including 4 in California, the United States. It also offers football parties. The company was founded in 2000 and is headquartered in East Kilbride, the United Kingdom.', 'GBP', '2019-08-03 22:46:46'),
(432, 'GOG', 'Go-Ahead Group (The)', 'Industrials', 'The Go-Ahead Group plc provides bus and rail passenger transportation services in the United Kingdom and Singapore. It operates through three segments: Regional Bus, London Bus, and Rail. The company also offers rail replacement and other contracted services. It serves the department for transport, and transport for London. The company was founded in 1987 and is headquartered in London, the United Kingdom.', 'GBP', '2019-08-03 22:47:09'),
(433, 'GOOD', 'Good Enrg', 'Utilities', 'Good Energy Group PLC, through its subsidiaries, engages in the purchase, generation, and sale of electricity from renewable sources in the United Kingdom. The company generates electric power by wind turbine machinery and solar panels. It also sells gas; and provides services related to micro-renewable generation. The company was formerly known as Monkton Group PLC. Good Energy Group PLC was founded in 1999 and is based in Chippenham, the United Kingdom.', 'GBP', '2019-08-03 22:47:41'),
(434, 'GOR', 'Gordon Dadds', 'Industrials', 'Gordon Dadds Group plc provides legal and professional, and independent financial advisory services to businesses and high net worth individuals in the United Kingdom. It also provides corporate, management, and IT services, as well as is involved in the business venture activities. The company is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:48:12'),
