(451, 'GYG', 'Global Yachting Group', 'Industrials', 'GYG plc operates as a superyacht painting, supply, and maintenance company worldwide. It operates in two segments, Coatings and Supply. The company offers painting and other finishing services to yachts and superyachts. It is also involved in fairing and painting of superyachts; repainting and finishing of superyachts as part of a refitting program; and selling and delivering maintenance materials, consumables, spare parts, and equipment for the care and operation of superyachts. In addition, the company offers its products and services primarily under the Pinmar, Pinmar Supply, Rolling Stock, ACA Marine, and Technocraft. The company was formerly known as Global Yachting Group Limited and changed its name to GYG plc in May 2017. GYG plc was founded in 1977 and is headquartered in Palma, Spain.', 'GBP', '2019-08-04 14:51:48'),
(452, 'HAS', 'Hays', 'Industrials', 'Hays plc operates as a recruitment company in Australia, New Zealand, Germany, the United Kingdom, Ireland, and internationally. The company offers permanent, temporary, and contractor recruitment services, such as qualified, professional, and skilled recruitment to public and private sector. It specializes in offering recruitment services in the areas of accountancy and finance, construction and property, information technology, life sciences, sales and marketing, banking and capital markets, contact centers, education, engineering and manufacturing, executive, financial services, health and social care, human resources, legal, office professionals, energy, oil and gas, purchasing, retail, resources and mining, and telecoms. Hays plc was founded in 1968 and is based in London, the United Kingdom.', 'GBP', '2019-08-04 14:53:05'),
(453, 'HAT', 'H&t Group Plc', 'Financial Services', 'H&T Group plc primarily provides pawn broking services in the United Kingdom. The company operates in six segments: Pawnbroking, Gold Purchasing, Retail, Pawnbroking Scrap, Personal Loans, and Other Services. It offers personal loans, as well as gold purchasing, jewelry retail, cheque cashing, unsecured lending, buyback, foreign exchange currency, and money transfer services. The company provides its products and services online and in-store. As of December 31, 2018, it operated 182 stores. The company was founded in 1897 and is headquartered in Sutton, the United Kingdom.', 'GBP', '2019-08-04 14:54:08'),
(454, 'HAYD', 'Haydale', 'Basic Materials', 'Haydale Graphene Industries PLC, through its subsidiaries, sources, handles, functionalizes, and processes nanomaterials with a suite of prototyping and analytical equipment in the United Kingdom, Europe, the United States, China, Thailand, South Korea, Japan, and internationally. It operates through two segments, Resins, Polymers and Composites; and Advanced Materials. The company offers resins, polymers, and composites; inks; advanced composites and elastomers; and novel SiC micro fibres and whiskers. The company was formerly known as Innovative Carbon Limited and changed its name to Haydale Graphene Industries PLC in March 2014. Haydale Graphene Industries PLC was incorporated in 2010 and is headquartered in Ammanford, the United Kingdom.', 'GBP', '2019-08-04 14:55:11'),
(455, 'HCM', 'Hutchison China', 'Healthcare', 'Hutchison China MediTech Limited, a commercial-stage biopharmaceutical company, engages in discovery, development, and commercialization of targeted therapeutics and immunotherapies for oncology and immunological diseases in the People\'s Republic of China and Hong Kong. The company operates through Innovation Platform and Commercial Platform segments. The company discovers and develops therapeutics in oncology and autoimmune diseases, as well as provides research and development services; and develops, manufactures, distributes, markets, and sells prescription and over-the-counter pharmaceutical products, and consumer health products under the Baiyunshan and Shang Yao brands. Its clinical stage drugs include Savolitinib, a c-MET inhibitor for the treatment of non-small cell lung cancer (NSCLC), papillary renal cell carcinoma, colorectal cancer, gastric cancer, and prostate cancer; and Fruquintinib, a inhibitor for the treatment of colorectal cancer and solid tumors. The company is also developing Surufatinib, an inhibitor for the treatment of pancreatic neuroendocrine tumors and solid tumors; and HMPL-523, an inhibitor for the treatment of indolent non-Hodgkin\'s lymphoma, as well as HMPL-689, a treatment for indolent non-Hodgkin\'s lymphoma and healthy volunteers. The company was incorporated in 2000 and is headquartered in Central, Hong Kong. Hutchison China MediTech Limited is a subsidiary of Hutchison Healthcare Holdings Limited.', 'GBP', '2019-08-04 14:56:16'),
(456, 'HDD', 'Hardide', 'Basic Materials', 'Hardide plc manufactures and sells tungsten carbide-based coatings for external and internal surfaces in the United Kingdom, Europe, North America, and internationally. The company offers custom coatings; and base material coatings for various steel and alloy materials, as well as coatings for seals. It provides its products for use in various industries and applications, including oil and gas, aerospace, valves, pumps, industrial diamond, power generation, motorsport, material processing, industrial tooling, and blades. The company was founded in 2000 and is headquartered in Bicester, the United Kingdom.', 'GBP', '2019-08-04 14:56:53'),
(457, 'HDT', 'Holders Tech.', 'Technology', 'Holders Technology plc, together with its subsidiaries, distributes special laminates and materials, equipment, and supplies for printed circuit board (PCB) industry in the United Kingdom, Germany, and internationally. It operates through PCB and LED segments. The company also distributes LED-related components, and lighting products and lighting solutions for the lighting industry. Holders Technology plc was founded in 1972 and is based in London, the United Kingdom.', 'GBP', '2019-08-04 14:57:33'),
(458, 'HER', 'Herencia', 'Basic Materials', 'Herencia Resources plc., together with its subsidiaries, provides metals and minerals exploration and development services. The company owns a portfolio of zinc, silver, lead, copper, and gold deposits in Chile. Its projects include the Picachos Copper project, which is located approximately 50 km south east of the coastal city of La Serena; and the Guamanga Copper-Gold project that covers an area of approximately 11.2 square kilometers, which comprises the iron oxide copper-gold and various porphyry targets, as well as tenement positions in the La Serena area located in northern Chile. The company also owns a 70% interest in the Paguanta project comprising Patricia zinc-silver-lead-gold mineral resource; Doris copper/silver prospect; and La Rosa porphyry-copper prospect located in northern Chile. The company was formerly known as Tarapaca Resources (Bermuda) Limited and changed its name to Herencia Resources plc. in November 2005. The company was incorporated in 2003 and is based in West Perth, Australia.', 'GBP', '2019-08-04 14:58:01'),
(459, 'HFD', 'Halfords Group', 'Consumer Cyclical', 'Halfords Group plc, through its subsidiaries, retails automotive, leisure, and cycling products in the United Kingdom and the Republic of Ireland. It operates in two segments, Retail and Car Servicing. The company retails auto parts, accessories, cycles, and cycle accessories; and provides garage servicing and auto repair services. It also offers bicycle replacement for insurance companies under the Wheelies brand; and bikes and cycling parts, accessories, and clothing through online under the Tredz brand. It operates approximately 460 retail stores; and 20 Cycle Republic stores. Halfords Group plc was founded in 1892 and is based in Redditch, the United Kingdom.', 'GBP', '2019-08-04 14:58:30'),
(460, 'HFG', 'Hilton Food', 'Consumer Defensive', 'Hilton Food Group plc, together with its subsidiaries, engages in the food packing business. The company offers a range of fresh items, such as roasting joints, steaks, chops, and minces. It also provides value-added products comprising barbecue ranges, marinated meats, meat cuts, serving sauces, and ready to cook products. The company supplies its products for international food retailers. It operates in the United Kingdom, the Netherlands, the Republic of Ireland, Sweden, Denmark, Poland, the Czech Republic, Hungary, Slovakia, Latvia, Lithuania, Estonia, Portugal, and Australia. Hilton Food Group plc was founded in 1994 and is based in Huntingdon, the United Kingdom.', 'GBP', '2019-08-04 14:59:04'),
(461, 'HGM', 'Highland Gold', 'Basic Materials', 'Highland Gold Mining Limited engages in the gold mining operations in Russia and Kyrgyzstan. The company explores for gold, silver, zinc, and lead. The company\'s Gold Production of Khabarovsk Region segment holds 100% interests in the Mnogovershinnoye mine, which is located in the Nikolaevsk area of the Khabarovsk Territory in the far-east of Russia; and the Belaya Gora, which is located in the Khabarovsk region, Russia. Its Gold Production of Chukotka Region segment holds interest in the Valunisty mine and the surrounding Kanchalano-Amguemskaya Square license located in the Anadyrsky district of the Russian Far East region of Chukotka. The company\'s Polymetallic Concentrate Production segment holds interest in the Novoshirokinskoye deposit that is located in the Zabaikalsky region, Russia. Its Development and Exploration segment holds 100% interests in the Kekura deposit, which is situated in the Chukotka region; the Klen deposit that is located in the southwest of Bilibino, north-eastern Russia; the Taseevskoye deposit, which is located in the Zabaikalsky region, Russia; and the Unkurtash project that is located in Kassan, Kyrgyzstan. This segment also holds interests in the Lubov project. The company also offers project engineering services. Highland Gold Mining Limited was incorporated in 2002 and is headquartered in Saint Helier, Jersey.', 'GBP', '2019-08-04 14:59:43'),
(462, 'HICL', 'HICL Infrastructure Co', NULL, NULL, 'GBP', '2019-05-13 20:34:10'),
(463, 'HIK', 'Hikma Pharmaceuticals', 'Healthcare', 'Hikma Pharmaceuticals PLC develops, manufactures, and markets a range of generic, branded, and in-licensed pharmaceutical products. It operates through three segments: Injectables, Generics, and Branded. The Injectables segment manufactures, markets, and sells generic injectable products for therapeutic categories, including oncology and anti-viral products to hospitals. The Generics segment develops and sells oral and other non-injectable generic products for retail market. The Branded segment develops, manufactures, and markets branded generics and in-licensed products to retail and hospital markets. The company offers products in various therapeutic areas, including respiratory, oncology, pain management, anti-infectives, cardiovascular, diabetes, and central nervous system. It operates in the United Kingdom, the United States, the Middle East, North Africa, Europe, and internationally. The company was founded in 1978 and is based in London, the United Kingdom.', 'GBP', '2019-08-04 15:00:41'),
(464, 'HILS', 'Hill & Smith Holdings', 'Industrials', 'Hill & Smith Holdings PLC designs, manufactures, and supplies infrastructure products; and provides galvanizing services. The company operates in three segments: Infrastructure Products  Utilities; Infrastructure Products - Roads; and Galvanizing Services segments. The Infrastructure Products  Utilities segment provides industrial floorings, plastic drainage pipes, security fencing, industrial platforms and flooring, glass reinforced composite railway platforms, flood prevention barriers, plastic drainage pipes, energy grid components, pipe supports, and steel and composite products for a range of infrastructure markets, including energy creation and distribution, rail, water, and house building. The Infrastructure Products - Roads segment designs, manufactures, and installs temporary and permanent safety products for the roads market together with intelligent transport systems, which provide information to road users. This segment also offers road safety barriers, variable message signs, traffic data collection systems, car parking solutions, street lighting columns, street furniture, and bridge parapets. The Galvanizing Services segment provides zinc and other coatings for a range of applications, including fencing, lighting columns, structural steel works, bridges, electricity substations, and other products for the agricultural, recreational, infrastructure, and construction markets. The company offers its products and services in the United Kingdom and rest of Europe; North America; the Middle East; Asia; and rest of world. Hill & Smith Holdings PLC was founded in 1960 and is based in Solihull, the United Kingdom.', 'GBP', '2019-08-04 15:01:34'),
(465, 'HL.', 'Hargreaves Lansdown', 'Financial Services', 'Hargreaves Lansdown plc provides direct-to-investor investment services for individuals and corporates in the United Kingdom and Poland. Its flagship service is Vantage, a direct-to-investor platform. The company offers stocks and shares individual savings accounts (ISAs), fund and share accounts, self-invested personal pensions (SIPPs), and lifetime ISAs. It also provides pension services, including SIPPs, annuities, drawdown, and mix and match pensions; share dealing services, such as overseas share dealing, initial public offerings and share offers, certificated share dealing, and exchange traded funds and exchange traded commodities/currencies; and fund dealing services. In addition, the company offers personal and business currency services; Junior ISA, SIPP, and investment accounts; and financial advisory services comprising investment management, lump sum investment, pension consolidation, portfolio restructuring, retirement planning, and estate planning services. Hargreaves Lansdown plc was founded in 1981 and is headquartered in Bristol, the United Kingdom.', 'GBP', '2019-08-04 15:02:08'),
(466, 'HLMA', 'Halma', 'Industrials', 'Halma plc provides technology solutions in the safety, health and environmental markets. It operates in four segments: Process Safety, Infrastructure Safety, Environmental & Analysis, and Medical. The Process Safety segment offers specialized interlocks that control critical processes safely; instruments that detect flammable and hazardous gases; and explosion protection and corrosion monitoring systems. This segment serves the gas detection, industrial access control, pressure management, and safe storage and transfer markets. The Infrastructure Safety segment provides fire detection systems, specialist fire suppression systems, people and vehicle flow technologies, and security sensors. It serves the fire detection and suppression, and elevator markets. The Environmental & Analysis segment opto-electronic technology and sensors, flow gap measurement instruments, and gas conditioning products, as well as solutions for environmental data recording, water quality testing, water distribution network monitoring, and UV water treatment. It serves the spectroscopy and photonics, water analysis and treatment, and environmental monitoring markets. The Medical segment offers devices that assess eye health; assist with eye surgery and primary care applications; critical fluidic components used by medical diagnostics and OEMs; and laboratories and sensor technologies used in hospitals to track assets and support patient and staff safety. This segment serves the diagnostics, sensor technology, ophthalmology, and patient assessment market. The company was founded in 1894 and is headquartered in Amersham, the United Kingdom.', 'GBP', '2019-08-04 15:02:20'),
(467, 'HMI', 'Harvest Mi (Di)', 'Basic Materials', 'Harvest Minerals Limited explores for and develops potash and phosphate projects in Brazil. It has four principal fertilizer projects, such as the Arapua Fertilizer project, the Sergi Potash project, the Capela Potash project, and the Mandacaru Phosphate project. The company was formerly known as Triumph Tin Limited and changed its name to Harvest Minerals Limited in December 2014. Harvest Minerals Limited was incorporated in 2010 and is based in Perth, Australia.', 'GBP', '2019-08-04 15:02:48'),
(468, 'HMLH', 'Hml Hldgs', 'Real Estate', 'HML Holdings plc, together with its subsidiaries, provides residential property management and related services in the United Kingdom. It operates through Property Management, Surveying Services, and Insurance Services segments. The company also offers chartered surveying, insurance broking intermediary, and concierge services. HML Holdings plc was founded in 1991 and is headquartered in Richmond, the United Kingdom.', 'GBP', '2019-08-04 15:03:41'),
(469, 'HMSO', 'Hammerson', 'Real Estate', 'We create vibrant, continually evolving spaces, in and around thriving cities, where people and brands want to be. We seek to deliver value for all our stakeholders and to create a positive and sustainable impact for generations to come.', 'GBP', '2019-08-04 15:04:18'),
(470, 'HOC', 'Hochschild Mining', 'Basic Materials', 'Hochschild Mining plc, a precious metals company, explores for, mines, processes, and sells silver and gold in the Americas. The company also offers doré and concentrates. It holds a 100% interests in the Inmaculada gold/silver underground operation and Pallancata silver/gold property, which are located in the Department of Ayacucho in southern Peru; and Arcata, an underground operation located in the Department of Arequipa in southern Peru, as well as a 51% interest in the San Jose silver/gold mine is located in Argentina. In addition, it has a portfolio of projects in various stages of development located in Peru, Argentina, Mexico, and Chile. Further, the company is involved in power transmission business. Hochschild Mining plc was founded in 1911 and is based in London, the United Kingdom.', 'GBP', '2019-08-04 15:04:53'),
(471, 'HOTC', 'Hotel Choc', 'Consumer Defensive', 'Hotel Chocolat Group plc manufactures, distributes, and retails chocolates under the Hotel Chocolat brand name in the United Kingdom, rest of Europe, and internationally. It offers a range of chocolates, including self-purchase, gift and occasion, and rare and vintage chocolates, as well as drinking chocolates, cocoa-infused alcohols, and cocoa-based beauty products. The company sells its products through a network of stores, as well as through online subscription; and operates a boutique hotel and cocoa estate. It also holds properties. As of January 23, 2019, Hotel Chocolat Group plc operated 117 stores in the United Kingdom. The company was founded in 1993 and is headquartered in Royston, the United Kingdom.', 'GBP', '2019-08-04 15:05:29'),
(472, 'HRI', 'Herald Investment Trust', NULL, NULL, 'GBP', '2019-05-13 20:34:09'),
(473, 'HRN', 'Hornby', 'Consumer Cyclical', 'Hornby PLC, through its subsidiaries, engages in the development, production, and supply of toy and hobby products. It offers products under various categories, including train sets, locomotives, train packs, wagons and coaches, themes, tracks and track accessories, buildings, platforms and bridges, and power and control, as well as spares and accessories. The company sells its products through a network of hobby specialists and retailers under the Hornby, Thomas & Friends, Skaledale, Arnold, Jouef, Lima, Rivarossi, and Electrotren brands. It operates in the United Kingdom and rest of Europe, the United State, Spain, and Italy. The company was founded in 1907 and is based in Margate, the United Kingdom.', 'GBP', '2019-08-04 15:06:29'),
