(1071, 'UTG', 'Unite Group', 'Real Estate', 'Unite Students is the UK\'s largest manager and developer of purpose-built student accommodation serving the country\'s world-leading higher education sector. We currently provide homes for almost 50,000 students in circa 130 properties across 22 leading university towns and cities in England and Scotland. Unite also has a strong development pipeline, which will deliver more than 6,000 beds in the next three years. Our 1,400 people are driven by a common purpose: to provide the students who live with us a \'Home for Success\' and to be the most trusted brand in the sector. We do this through quality service, quality people and quality properties, all designed on the basis of an unrivalled insight into students\' needs and preferences. Unite\'s accommodation is high quality, safe and secure, and located close to university campuses, transport links and local amenities. Students live predominantly in en-suite study bedrooms with rents covering all bills, insurance, 24-hour security, fortnightly cleaning services and high-speed Wi-Fi. MyUnite, our mobile app, provides practical support such as instant messaging and maintenance requests. Our commitment to customer service is powered by an innovative, in-house operating platform. It provides a wide range of benefits to our students, such as an optimised online booking process, as well as providing us with a unique ability to drive value from our portfolio through scale efficiencies and revenue management. Alongside delivering quality service, our other strategic priority is delivering growing and sustainable earnings, underpinned by a strong capital structure. A key part of this strategy is growing the number of beds let though partnerships with mid and high tariff universities which are experiencing record levels of student demand. We currently partner with 60 higher education institutions, guaranteeing that approximately 60% of our rooms are let under multiyear, \'nomination agreements\' providing high visibility of forward occupancy and rental growth. Unite is invested in and operates two specialist funds and joint ventures with institutional investment partners: the £2 billion Unite UK Student Accommodation Fund (USAF), and the £1 billion London Student Accommodation Vehicle (LSAV). Unite is the founder of and major donor to the Unite Foundation, a charitable trust established to support talented students facing challenging financial circumstances through the provision of free accommodation annual scholarships. The Foundation has so far provided scholarships for 250 young people working in close collaboration with 28 universities. Founded in 1991 in Bristol, Unite Group is an award-winning Real Estate Investment Trust (REIT), listed on the London Stock Exchange and a member of the FTSE 250 Index.', 'GBP', '2019-08-03 21:08:19'),
(1072, 'UTW', 'Utilitywise', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(1073, 'UU.', 'United Utilities Group', 'Utilities', 'United Utilities Group PLC provides water and wastewater services in the United Kingdom. It is also involved in renewable energy generation, corporate trustee, financing, and property management activities; and the provision of waste treatment, consulting, and project management services. The company operates 77,000 kilometers (km) of water pipes; 77,000 km of wastewater pipes; 569 wastewater treatment works; and 88 water treatment works. It serves 3 million households and 200,000 business customers. United Utilities Group PLC is based in Warrington, the United Kingdom.', 'GBP', '2019-08-03 21:08:26'),
(1074, 'UVEL', 'Univision', 'Industrials', 'UniVision Engineering Limited, an investment holding company, designs, supplies, consults, installs, and maintains closed circuit televisions in the People\'s Republic of China. It provides video matrix switchers/controllers, on-site receivers/driver color cameras, quad units and multiplexers, video distribution amplifiers, sequential video switcher, indoor camera enclosures, fiber optic transmitter/receivers, digital video recording systems, digital network surveillance systems, and digital security monitoring and control system software. The company also offers IP network intercom and security intercom products; and sells security related products. UniVision Engineering Limited was founded in 1979 and is based in Kwun Tong, Hong Kong.', 'GBP', '2019-08-03 21:08:38'),
(1075, 'VAL', 'Valirx', 'Healthcare', 'ValiRx plc, a biotechnology oncology focused company, engages in developing novel treatments for cancer and associated biomarkers in the United Kingdom. Its proprietary GeneICE technology enables the selective silencing of specific genes by targeted histone deacetylation leading to chromatin condensation. The company\'s lead drug candidates include VAL201, an anti-cancer therapeutic that is in Phase I/II trials for the treatment of prostate cancer and other indications of hormone induced unregulated growth, including endometriosis; VAL301, a reformulation of VAL201, which is in pre-clinical development for the non-invasive and better tolerated treatment of endometriosis; and VAL401, a reformulation of generic drug Risperidone, which has completed Phase II clinical trials for the treatment of non-small cell lung cancer. Its drug candidates also comprise VAL101, a therapeutic based on GeneICE platform that acts to target and switch off the Bcl-2 gene, a protein that is implicated carcinomas. It has licensing collaborations with Imperial Innovations Group plc, Cancer Research UK, and University College London Hospital. ValiRx plc was incorporated in 2000 and is based in Hatfield Heath, the United Kingdom.', 'GBP', '2019-08-03 21:08:44'),
