(1101, 'VRP', 'Verona Pharma', 'Healthcare', 'Verona Pharma plc, a clinical stage biopharmaceutical company, develops and commercializes therapeutics to treat respiratory diseases. The company\'s product candidate is RPL554, an inhaled dual inhibitor of the enzymes phosphodiesterase 3 and 4, which has completed Phase I and II clinical trials that acts as a bronchodilator and an anti-inflammatory agent for the treatment of chronic obstructive pulmonary disease, cystic fibrosis, chronic asthma, and allergic rhinitis. Verona Pharma plc was founded in 2005 and is headquartered in London, the United Kingdom.', 'GBP', '2019-08-18 20:18:52'),
(1102, 'VRS', 'Versarien', 'Basic Materials', 'Versarien plc, an engineering materials company, provides engineering solutions for various industry sectors in the United Kingdom, rest of Europe, North America, and internationally. The company operates in two segments, Graphene and Plastic Products, and Hard Wear and Metallic Products. The Graphene and Plastic Products segment offers graphene products, such as Nanene, a few-layer graphene; and Hexotene, a few-layer hexagonal boron nitride nano-platelet powder, as well as a range of electrically conductive graphene inks for various printing processes, substrates, and applications under the Graphinks name. The Hard Wear and Metallic Products segment provides vacuum-formed and injection-molded products, including graphene enhanced mobile accessories, injection molding products, tool boxes, transit trays, PU foam tanks, and vacuum forming products for use in automotive, construction, utility, and retail sectors. This segment also offers sintered tungsten carbide products comprising special inserts and blanks, cutting knives, wear-resistant parts, nozzles and valve inserts for flow control, and defense and aerospace tungsten carbide parts for use in arduous environment applications; and microporous metals for the thermal management industry, as well as supplies extruded aluminum products, such as aluminum industrial products and aluminum heat sinks. The company was founded in 2010 and is headquartered in Cheltenham, the United Kingdom.', 'GBP', '2019-08-18 20:19:38'),
