(1121, 'WKP', 'Workspace Group', 'Real Estate', 'Workspace is focused on helping businesses perform at their very best. The Workspace Advantage is our unique customer offer and is open to all  we provide inspiring, flexible work spaces with super-fast technology in dynamic London locations. Established in 1987, and listed on the London Stock Exchange since 1993, Workspace owns and manages 3.9 million sq. ft. of business space across 64 London properties which it lets directly to customers. We are home to thousands of businesses including some of the fastest growing and established brands across a wide range of sectors. The way businesses work is changing. That\'s why we continually invest in providing the technology infrastructure that enables our customers to think and move fast, and alongside their working environment, is tailored to each individual business. Workspace (WKP) is a FTSE 250 listed Real Estate Investment Trust (REIT) and a member of the European Public Real Estate Association (EPRA).', 'GBP', '2019-08-03 22:10:31'),
(1122, 'WLFE', 'Wolf Minerals', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(1123, 'WMH', 'William Hill', 'Consumer Cyclical', 'William Hill plc provides sports betting and gaming services in the United Kingdom and internationally. It operates through Retail, Online, US Existing, US Expansion, and Other segments. The company operates licensed betting offices that offer sports betting services on football, horseracing, and other sports, as well as gaming on machines. It also operates online betting and gaming business that provides in-play and pre-match sports betting services and a range of gaming products; and offers casino, poker sites, and other gaming products, as well as telephone betting services. Further, the company is involved in on-course betting operations. William Hill plc was founded in 1934 and is headquartered in London, the United Kingdom.', 'GBP', '2019-08-03 22:18:41');
INSERT INTO `stock_symbol_list` (`stock_id`, `stock_symbol`, `stock_name`, `stock_sector`, `stock_description`, `stock_currency`, `last_updated`) VALUES
(1124, 'WPHO', 'Windar Photo', 'Technology', 'Windar Photonics Plc, through its subsidiaries, develops and sells light detection and ranging sensors, and associated products for use on electricity generating wind turbines. It offers WindEye and WindVision sensors, which measure wind direction and wind speed by scanning a laser beam ahead of the wind turbines. The company also provides WindTIMIZER for wind turbine\'s controller; and retrofit control system for wind turbines. It serves original equipment manufacturers, independent power producers, and wind park operators in Europe, the Americas, and Asia. The company was incorporated in 2014 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:18:46'),
(1125, 'WPP', 'WPP Group', 'Consumer Cyclical', 'WPP plc, a creative transformation company, provides communications, experience, commerce, and technology services worldwide. The company operates through four segments: Advertising and Media Investment Management; Data Investment Management; Public Relations & Public Affairs; and Brand Consulting, Health & Wellness and Specialist Communications. It offers advertising, content, media investment, and public relations and public affairs services; and branding and design, service design, and platforms and applications. The company also creates direct-to-consumer platforms and helps clients navigate marketplaces; and provides online and offline commerce solutions. In addition, it provides data management, marketing technology consulting, and systems integration services. WPP plc was founded in 1985 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:18:52'),
(1126, 'WRES', 'W Resources', 'Basic Materials', 'W Resources Plc engages in the exploration and development of tungsten, tin, copper, and gold properties. Its flagship project is the La Parrilla tungsten project located in Spain. The company was formerly known as Caspian Holdings Plc and changed its name to W Resources Plc in July 2012. W Resources Plc was incorporated in 2004 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:18:59'),
(1127, 'WRL', 'Wentworth Res.', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(1128, 'WSBN', 'Wishbone', 'Basic Materials', 'Wishbone Gold Plc engages in the resource evaluation, and gold production and trading activities. The company holds interest in the four gold exploration licenses covering an area of 34,000 acres in north east Queensland, Australia. It also operates as a precious metals and gem trader in Dubai, Columbia, Honduras, Chile, and Peru. The company was founded in 2009 and is based in Gibraltar.', 'GBP', '2019-08-03 22:19:06'),
(1129, 'WSG', 'Westminster Group', 'Industrials', 'Westminster Group PLC, a specialist security and services company, designs and supplies technology solutions and services to governments and government agencies, non-governmental organizations, and blue chip commercial organizations. It operates through three segments: Managed Services Aviation, Technology, and Managed Services Guarding. The company offers technology led security solutions, such as surveillance, detection, tracking, screening, and interception technologies; managed services, such as security services and solutions in airports, ports, and other facilities; and manpower, consultancy, and training services. It is also involved in the provision of managed services under long term contracts to airports, ports, and other facilities, as well as security and risk management services, including manned guarding, mobile patrols, risk management, terminal guarding, and K9 services; and marine transport, ferry and other infrastructure management, and managed services infrastructure businesses, as well as local infrastructure for airport operations. The company has operations in the United Kingdom, Europe, Africa, Asia, the Middle East, the Americas, and internationally. Westminster Group PLC was incorporated in 2000 and is headquartered in Banbury, the United Kingdom.', 'GBP', '2019-08-03 22:19:11'),
(1130, 'WTAN', 'Witan Investment Trust', 'Financial Services', 'Witan Investment Trust plc is a closed-ended equity mutual fund launched and managed by Witan Investment Services Limited. The fund is co-managed by Artemis Investment Management LLP, Lindsell Train Limited, Heronbridge Investment Management LLP, MFS International (UK) Limited, Veritas Asset Management LLP, Lansdowne Partners (UK) LLP, Marathon Asset Management, LLP, Matthews International Capital Management, LLC, Trilogy Global Advisors, LLC, Pzena Investment Management LLC, Tweedy, Browne Company LLC, and GQG Partners, LLC. It invests in public equity markets across the globe. The fund seeks to invest in stocks of companies operating across diversified sectors. It primarily invests in dividend paying growth and value stocks of companies. The fund employs fundamental analysis with a bottom-up stock picking approach to create its portfolio. It seeks to benchmarks the performance of its portfolio against a composite index comprised of 40% FTSE All-Share Index, 20% FTSE All-World North America Index, 20% FTSE All-World Europe (ex UK) Index, and 20% FTSE All-World Asia Pacific Index. The fund conducts in-house research to make its investments. Witan Investment Trust plc was formed in 1909 and is domiciled in the United Kingdom.', 'GBP', '2019-08-03 22:19:14'),
(1131, 'WTB', 'Whitbread', 'Consumer Cyclical', 'Whitbread PLC operates hotels and restaurants in the United Kingdom. It operates approximately 800 hotels with 76,171 rooms under the Premier Inn and the hub by Premier Inn brand names; and restaurants under the Brewers Fayre, Beefeater Grill, coockhouse & Pub, Bar+Block, thyme, and Table Table brands. The company was founded in 1742 and is based in Dunstable, the United Kingdom.', 'GBP', '2019-08-03 22:19:21'),
(1132, 'WTG', 'Watchstone Grp', 'Healthcare', 'Watchstone Group plc provides technology solutions to the insurance, automotive, and healthcare industries in the United Kingdom, Canada, the United States, and internationally. It operates through two segments, Ingenie and Healthcare Services. It owns and operates physical rehabilitation clinics; and offers InnoCare, a clinic management software platform, as well as provides call center and customer service operation services. In addition, the company provides insurance broking services, as well as feedback and advice for drivers to enhance their driving skills. The company was formerly known as Quindell Plc and changed its name to Watchstone Group plc in November 2015. Watchstone Group plc was founded in 2000 and is based in Eastleigh, the United Kingdom.', 'GBP', '2019-08-03 22:19:28'),
(1133, 'WWH', 'Worldwide Healthcare Trust', 'Financial Services', 'Worldwide Healthcare Trust PLC is a closed ended equity mutual fund launched by Frostrow Capital LLP. The fund is managed by OrbiMed Capital LLC. It invests in public equity markets across the globe. The fund seeks to invest in stocks of companies operating in the healthcare sector, with an emphasis on pharmaceutical and biotechnology companies. It primarily invests in growth stocks of large-cap companies with a market capitalization of at least $5 billion. The fund employs fundamental analysis with a bottom-up stock picking approach to create its portfolio. It benchmarks the performance of its portfolio against the MSCI World Healthcare Index. The fund employs internal research to make its investments. It was formerly known as Finsbury Worldwide Pharmaceutical Trust plc. Worldwide Healthcare Trust PLC was formed in April 1995 and is domiciled in the United Kingdom.', 'GBP', '2019-08-03 22:19:34'),
(1134, 'WYG', 'Wyg', NULL, NULL, 'GBP', '2019-05-13 19:06:57'),
(1135, 'WYN', 'Wynnstay', 'Basic Materials', 'Wynnstay Group Plc manufactures and supplies agricultural products in the United Kingdom. It operates through Agriculture and Specialist Agricultural Merchanting segments. The Agriculture segment offers animal nutrition products to the agricultural market; and cereal and herbage seeds, and fertilizers to arable and grassland farmers, as well as trades in grains. The Specialist Agricultural Merchanting segment provides specialist products to farmers, smallholders, and pet owners. This segment operates through approximately 50 rural retail outlets under the Wynnstay Stores name; and online stores. It also manufactures and acts as a distributor of equine and small animal feeds through wholesalers and retailers. The company was founded in 1917 and is headquartered in Llansantffraid-ym-Mechain, the United Kingdom.', 'GBP', '2019-08-03 22:19:41'),
(1136, 'XLM', 'Xlmedia', 'Technology', 'XLMedia PLC, an online performance marketing company, attracts paying users from various online and mobile channels and directs them to online businesses in Scandinavia, other European countries, North America, Asia, Oceania, and internationally. It operates through Publishing, Media, and Other segments. The company owns approximately 2,300 informational Websites in 18 languages. It also acquires online and mobile advertising targeted at potential online traffic with the objective of directing it to the customers, as well as buys advertising space on search engines, Websites, mobile and social networks, and places adverts referring potential users to the customers\' Websites or to its own Websites; and manages networks of marketing partners. The company was formerly known as Webpals Marketing Systems Ltd. and changed its name to XLMedia PLC in 2008. XLMedia PLC was founded in 2008 and is headquartered in Limassol, Cyprus.', 'GBP', '2019-08-03 22:19:45'),
(1137, 'XPD', 'Xpediator Plc', 'Industrials', 'Xpediator Plc, together with its subsidiaries, provides freight management services in the United Kingdom and Europe. It operates in three segments: Freight Forwarding, Affinity, and Logistics & Warehousing. The company offers freight forwarding and courier solutions by road, ocean, and air, as well as stock management, short and long term warehousing, and on site packing services; and B2B freight forwarding and courier services to the e-commerce, food, procurement, and oil industries. It also provides freight forwarding services for flooring, machinery, household goods, and garments; and operates a network of Pall-Ex, a palletised freight express transport service, which uses a network of regional and central hubs to move goods with a full overnight load. In addition, the company offers groupage, full and part load transportation, warehousing, logistics, and fulfilment solutions; and end-to-end supply chain solutions comprising inbound logistics, storage, and related services, as well as final mile delivery. Further, it is involved in the e-commerce fulfilment; storage and related value added activities; domestic express delivery of small shipments of palletized freight; and collection of full and part-loads within national markets, as well as provision of cross-border online delivery, and fashion logistics and related services. Additionally, the company offers transport solutions under the Affinity brand, including credit cards for payment of fuel, tolls, and related services; ferry crossing booking; broker services for funders and leasing entities; and GPS solutions. It also operates warehouse facilities in Romania and serves blue chip customers within various sectors, including technology, manufacturing, FMCG, automotive, agriculture, retail, and commerce. The company was formerly known as Xpediator Services PLC and changed its name to Xpediator Plc in December 2016. Xpediator Plc was founded in 1988 and is headquartered in Braintree, United Kingdom.', 'GBP', '2019-08-03 22:19:47'),
(1138, 'XSG', 'Xeros Tech', 'Industrials', 'Xeros Technology Group plc, together with its subsidiaries, develops and commercializes polymer based cleaning equipment, consumables, and services in Europe and North America. The company also engages in the research, development, and commercialization of polymer technology alternatives to traditional aqueous based technologies. Its technologies reduce water consumption in the fields of fabric and garment manufacture, and industrial and domestic laundry. The company was formerly known as Hamsard 3323 Limited and changed its name to Xeros Technology Group plc in March 2014. Xeros Technology Group plc was incorporated in 2013 and is based in Rotherham, the United Kingdom.', 'GBP', '2019-08-03 22:19:51'),
(1139, 'XTR', 'Xtract', 'Basic Materials', 'Xtract Resources Plc operates as a resource, development and mining company. Its principal property is the Manica gold project located in Mozambique. The company was formerly known as Xtract Energy PLC and changed its name to Xtract Resources Plc in June 2013. Xtract Resources Plc was founded in 2004 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:19:55'),
(1140, 'YNGA', 'Young & Co \'\'A\'\'', 'Consumer Cyclical', 'Young & Co.\'s Brewery, P.L.C. operates and manages pubs and hotels in the United Kingdom. The company operates through two segments, Young\'s Managed Houses and Ram Pub Company. It sells drinks and food, as well as provides accommodation services; and owns, leases, and sub leases its owned or leased pubs to third parties. As of April 9, 2019, it had 201 managed pubs and 69 tenanted pubs primarily located in London and the South East. Young & Co.\'s Brewery, P.L.C. was founded in 1831 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:20:02'),
(1141, 'YNGN', 'Young & Co N/v', 'Consumer Cyclical', 'Young & Co.\'s Brewery, P.L.C. operates and manages pubs and hotels in the United Kingdom. The company operates through two segments, Young\'s Managed Houses and Ram Pub Company. It sells drinks and food, as well as provides accommodation services; and owns, leases, and sub leases its owned or leased pubs to third parties. As of April 9, 2019, it had 201 managed pubs and 69 tenanted pubs primarily located in London and the South East. Young & Co.\'s Brewery, P.L.C. was founded in 1831 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:20:07'),
(1142, 'YOLO', 'Yolo Leisure', 'Financial Services', 'Yolo Leisure and Technology plc, an investment company, focuses on investing in the technology, travel, leisure, and media sectors. The company offers various end-to-end technology services eco-system, including a range of multi-platform TV and video distribution products, such as low latency online simulcasts of TV channels, real-time sports highlights clipping, broadcaster catch-up services, social video syndication, and subscriber management services to broadcasters and rights owners. It also provides multi-channel, multi-territory frontend templated applications for a range of connected devices comprising mobiles, tablets, connected TVs, and over the top platforms that include Amazon Fire TV, Apple TV, and Roku, as well as Hybrid TV solutions to power catchup services on Freeview, Freesat, YouView, and EETV for various broadcasters. In addition, the company offers TVPlayer, a next generation pay TV platform that provides live, catch-up, on demand, and Pay Per View services, as well as streams approximately 98 TV channels; and TVPlayer Plus, a TV Broadcast platform, as well as ITV Box Office, a pay-per-view service that includes the World Boxing Super Series. Further, it provides GFinity, an end-to-end eSports solution, which offers on-line competitions and content to engage the eSports community; technology and services to the eSports market; and spoken-word audio or podcasting platforms for hosting, distributing, and monetizing content that enables the creation, broadcast, and syndication of audio content across various networks and geographies, as well as engages in the music entertainment technology business. The company was formerly known as Pentagon Protection plc and changed its name to Yolo Leisure and Technology plc in July 2014. Yolo Leisure and Technology plc was incorporated in 2002 and is based in London, the United Kingdom.', 'GBP', '2019-08-03 22:20:21'),
(1143, 'YOU', 'Yougov', 'Consumer Cyclical', 'YouGov plc provides online market research services in the United Kingdom, the United States, Germany, the Nordic countries, the Middle East, France, Mainland Europe, and the Asia Pacific. It operates through three divisions: Data Products, Data Services, and Custom Research. The Data Products division offers audience segmentation and targeting service tool under the YouGov Profiles name; and BrandIndex, a daily brand tracking service. The Data Services division provides YouGov Omnibus, a data service to obtain answers from national and selected samples; and Collaborate, a self-service survey design tool. The Custom Research division offers quantitative and qualitative research services. The company is also involved in the software development and media production businesses, as well as provision of operations services. YouGov plc was founded in 2000 and is headquartered in London, the United Kingdom.', 'GBP', '2019-08-03 22:20:25'),
(1144, 'ZAM', 'Zambeef Prod.', 'Consumer Defensive', 'Zambeef Products PLC, together with its subsidiaries, engages in the agri-businesses in Zambia and internationally. It operates through 14 divisions: Beef, Chicken, Pork, Crops, Stockfeed, Eggs, Fish, Milk and Dairy, Edible Oils, Mill and Bakery, Leather and Shoe, Master Meats (Nigeria), and Master Meats (Ghana). The company engages in the production, processing, distribution, and retailing of beef, chicken, pork, milk, eggs, dairy products, fish, flour, and stock feed. It is also involved in cereal row cropping operations, primarily maize, soya beans, and wheat with approximately 7,971 hectares of row crops under irrigation and 8,623 hectares of rain-fed/dry-land crops; and palm tree plantation. The company operates 174 retail outlets throughout Zambia and West Africa. In addition, it produces leather, industrial footwear, and protective leather clothing. Zambeef Products PLC was incorporated in 1994 and is headquartered in Lusaka, Zambia.', 'GBP', '2019-08-03 22:20:32'),
(1145, 'ZBO', 'Zibao Metals', 'Basic Materials', 'Zibao Metals Recycling Holdings Plc, through its subsidiaries, engages in trading non-ferrous metals, principally aluminum and copper in China. The company was founded in 2006 and is based in Cheung Sha Wan, Hong Kong.', 'GBP', '2019-08-03 22:20:39'),
(1146, 'ZIN', 'Zinc Media', 'Consumer Cyclical', 'Zinc Media Group plc, a multimedia company, produces television and radio programs in the United Kingdom and internationally. The company operates through three segments: TV, Publishing, and Digital. It operates television production activities under the Reef TV, Blakeway, Blakeway North, Brook Lapping, Films of Record, and Tern Television brand names. The company also engages in the creation and management of Websites and online TV channels; publishing, Website, event management, video production, and specialized communication operations; and digital marketing activities. In addition, it offers contract publishing services; and manages a digital and cross-platform education program, as well as various educational Websites. The company was formerly known as Ten Alps plc and changed its name to Zinc Media Group plc in November 2016. Zinc Media Group plc was founded in 1999 and is headquartered in London, the United Kingdom.', 'GBP', '2019-08-03 22:20:43'),
(1147, 'ZIOC', 'Zanaga Iron Ore', 'Basic Materials', 'Zanaga Iron Ore Company Limited, an investment holding company, explores for and develops iron ore properties. Its flagship asset is the Zanaga Iron Ore Project located in the south west of the Republic of Congo. The company was formerly known as Jumelles Holdings Limited and changed its name to Zanaga Iron Ore Company Limited in October 2010. Zanaga Iron Ore Company Limited was incorporated in 2009 and is based in Road Town, the British Virgin Islands.', 'GBP', '2019-08-03 22:20:50'),
(1148, 'ZOL', 'Zoltav Res', 'Energy', 'Zoltav Resources Inc. acquires, explores for, develops, and produces hydrocarbons in Russia. The company holds interests in the Bortovoy license covering an area of 3,215 square kilometers with proved plus probable reserves of 750 billion cubic feet of gas, and 3.9 million barrels of oil and condensate located in the Saratov region of south western Russia. It also owns interests in the Koltogor exploration and production license containing the Koltogor oil field covering an area of 528 square kilometers with proved plus probable reserves of 79.2 million barrels of oil equivalent located in the Khantiy-Mansisk Autonomous Okrug of Western Siberia; and the Koltogor exploration and production license 10 containing the West Koltogor oil field covering an area of 167 square kilometers. Zoltav Resources Inc. was incorporated in 2003 and is based in Grand Cayman, the Cayman Islands.', 'GBP', '2019-08-03 22:20:58'),
(1149, 'ZOO', 'Zoo Digital', 'Technology', 'ZOO Digital Group plc, through its subsidiaries, provides cloud-based localization and digital distribution services in the United Kingdom and the United States. It operates through three segments: Localisation, Digital Packaging, and Software Solutions. The company offers subtitling, dubbing, scripting, subtitling for TV adverts, and closed captioning services, as well as localization of artwork and metadata, and editing of compliance; and packs and distributes TV and movie content. Its cloud platforms include ZOOsubs, a cloud-based platform for producing, managing, and converting subtitles and captions; ZOOdubs, a cloud-based platform for offering dubbing services; ZOOscreen, a platform for screening, sharing, and showcasing TV and movie content; ZOOcore, a workflow management platform for managing projects and people; ZOOhive, a platform for preparing and repackaging assets for various digital distribution channels; and ZOOvault, a central place to store, search, and download assets. The company also engages in the media production and technology development activities; and sells and distributes technology products. It serves studios, broadcasters, online retailers, and over-the-top distributors. ZOO Digital Group plc was incorporated in 1999 and is headquartered in Sheffield, the United Kingdom.', 'GBP', '2019-08-03 22:21:02'),
(1150, 'ZYT', 'Zytronic', 'Technology', 'Zytronic plc, together with its subsidiaries, develops and manufactures interactive touch sensor products. It offers a range of secure encrypted touch sensors in transactional kiosks, curved interactive surfaces for casino cabinets, and rugged anti-microbial glass touch screens for leisure, digital signage, retail, surfaces, banking, and industrial applications. The company markets its products through a network of representatives and resellers. It primarily operates in the Americas, Europe, the Middle East, Africa, Hungary, the United Kingdom, the Asia Pacific, and South Korea. Zytronic plc was incorporated in 1999 and is based in Blaydon-on-Tyne, the United Kingdom.', 'GBP', '2019-08-03 22:21:07');
